import React, { Component } from 'react';

class PhoneInfo extends Component {
  render() {
    const { name, phone, id } = this.props.information;

    const style = {
      border: '1px solid black',
      padding: '8px',
      margin: '8px',
    };
    return (
      <div>
        <div style={style}>
          <b>{name}</b>
        </div>
        <div>{phone}</div>
      </div>
    );
  }
}

export default PhoneInfo;
